import 'dart:convert';

import 'package:medhealth/roleadmin/pages/buatTab3/model/product.dart';
import 'package:shared_preferences/shared_preferences.dart';

class ProductDetail {
  static SharedPreferences _preferences;

  static const _keyProduct = 'product';
  static const myProduct = Product(
      // imagePath: 'assets/img_fever.png',
      imagePath:
          '',
      name: '',
      kategori: '',
      harga: '',
      informasi: '');

  static Future init() async =>
      _preferences = await SharedPreferences.getInstance();

  static Future setProduct(Product product) async {
    final json = jsonEncode(product.toJson());

    await _preferences?.setString(_keyProduct, json);
  }

  static Product getProduct() {
    final json = _preferences?.getString(_keyProduct);

    return json == null ? myProduct : Product.fromJson(jsonDecode(json));
  }
}
